// Renderizar proyectos
$(document).ready(function () {
  proyectos.forEach(proyecto => {
    const tecnologiasWeb = proyecto.tecnologias.map(tech =>
      `<span class="badge bg-secondary me-1 mb-1">${tech}</span>`
    ).join('');

    const tarjeta = `
          <div class="col-md-6 col-lg-4" data-tech="${proyecto.tecnologias.join(' ').toLowerCase()}">
            <div class="card project-card h-100">
              <img src="${proyecto.imagen}" class="card-img-top" alt="${proyecto.titulo}">
              <div class="card-body">
                <h5 class="card-title">${proyecto.titulo}</h5>
                <p class="card-text">${proyecto.descripcion}</p>
                <div class="mb-3">${tecnologiasWeb}</div>
              </div>
              <div class="card-footer bg-white border-0">
                <div class="d-flex justify-content-between">
                  <a href="${proyecto.enlace}" class="btn btn-sm btn-primary" target="_blank">
                    <i class="fas fa-external-link-alt me-1"></i> Demo
                  </a>
                  <a href="${proyecto.github}" class="btn btn-sm btn-outline-secondary" target="_blank">
                    <i class="fab fa-github me-1"></i> Código
                  </a>
                </div>
              </div>
            </div>
          </div>
        `;
    $("#project-list").append(tarjeta);
  });

  // Manejar el formulario de contacto
  $("#contact-form").submit(function (e) {
    e.preventDefault();
    alert("¡Gracias por tu mensaje! Me pondré en contacto contigo pronto.");
    this.reset();
  });
});

const filterButtons = document.querySelectorAll('.filter-btn');

filterButtons.forEach(btn => {
  btn.addEventListener('click', () => {
    const tech = btn.getAttribute('data-tech');
    const projects = document.querySelectorAll('#project-list [data-tech]');

    filterButtons.forEach(b => b.classList.remove('active'));
    btn.classList.add('active');

    projects.forEach(p => {
      if (tech === "all") p.style.display = "block";
      else p.style.display = p.getAttribute('data-tech').includes(tech) ? "block" : "none";
    });
  });
});
